import React, { useState, useEffect } from "react";
import { Routes, Route } from "react-router-dom";
import UserService from "./services/user.service";

import NavComponent from "./components/navbar-component";
import BobaComponent from "./components/boba-component";
import RegisterComponent from "./components/register-component";
import LoginComponent from "./components/login-component";
import HomeComponent from "./components/home-component";
import './App.css';

function App() {
  const [loginState, setLoginState] = useState(UserService.isLogin());

  // useEffect(() => {
  // }, [loginState])
  return (
    <div className="App">
      <NavComponent loginState={loginState} setLoginState={setLoginState} />
      <Routes>
        <Route path="/" exact element={<BobaComponent/>} />
        <Route path="/login" element={<LoginComponent loginState={loginState} setLoginState={setLoginState}/>} />
        <Route path="/register" element={<RegisterComponent loginState={loginState}/>} />
        <Route path="/home" element={<HomeComponent loginState={loginState}/>} /> 
      </Routes>
    </div>
  );
}

export default App;
